function exportTest() {
  const content =
    '\r\n  <!DOCTYPE html>\r\n  <html>\r\n    <head>\r\n    <meta charset="UTF-8" />\r\n    <meta name="viewport" content="width=device-width, initial-scale=1.0" />\r\n    <title>Ulo\u017Eit test jako PDF</title>\r\n    <link rel="shortcut icon" href="src/logo.ico" type="image/x-icon" />\r\n    <script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js"></script>\r\n    <script src="https://cdnjs.cloudflare.com/ajax/libs/html2pdf.js/0.9.3/html2pdf.bundle.min.js"></script>\r\n    </head>\r\n    <style>\r\n      @font-face {\r\n        font-family: "MyriadPro";\r\n        font-weight: normal;\r\n        src: url("./src/fonts/MyriadPro-Regular.ttf") format("truetype");\r\n      }\r\n      @font-face {\r\n        font-family: "MyriadPro";\r\n        font-weight: bold;\r\n        src: url("./src/fonts/MyriadPro-Bold.ttf") format("truetype");\r\n      }\r\nbody {\r\n        font-family: MyriadPro, sans-serif;\r\n      }\r\n</style>\r\n  <body\r\n  >\r\n    <h1>Test se generuje, po\u010Dkejte pros\u00EDm.</h1>\r\n    \r\n    <script>\r\n    function decodeAndCopyHtml(html) {\r\n  var txt = document.createElement("textarea");\r\n  txt.innerHTML = html;\r\n  const textarea = document.createElement("textarea");\r\n  textarea.value = txt.value;\r\n  textarea.setAttribute("readonly", "");\r\n  textarea.style.position = "absolute";\r\n  textarea.style.left = "-9999px";\r\n  document.body.appendChild(textarea);\r\n  textarea.select();\r\n  document.execCommand("copy");\r\n  document.body.removeChild(textarea);\r\n}\r\n\r\nfunction getBodForm(number) {\r\n  if (number === 1) {\r\n    return "bod";\r\n  } else if ([2, 3, 4].includes(number)) {\r\n    return "body";\r\n  } else {\r\n    return "bod\u016F";\r\n  }\r\n}\r\n\r\nconst urlParams = new URLSearchParams(window.location.search);\r\nconst projectIndex = parseInt(urlParams.get("projectIndex"), 10);\r\nconst projects = JSON.parse(localStorage.getItem("projects") || "[]");\r\nconst project = projects[projectIndex] || null;\r\nconst nazevTestu = project?.name || "Nezn\u00E1m\u00FD test";\r\nconst pocetUloh = project?.totalQuestions || "0";\r\nconst maxBodu = project?.totalPoints || "0";\r\nconst povolenePomucky = project?.tools || "Neuvedeno";\r\nconst questions = project.questions || [];\r\n\r\n// templates\r\nconst currentQuestionIndex = 1; // number of the current question in the test array\r\nconst currentQuestion = questions[currentQuestionIndex]; // current question object\r\n\r\n/*\r\n// ABCD\r\nconst ABCDquestionTemplate = `<section style="position: relative">\r\n      <div style="text-align: right; font-weight: bold; margin-top: 0.5cm">\r\n        ${currentQuestion.points} ${getBodForm(currentQuestion.points)}\r\n      </div>\r\n      <div style="font-weight: bold" id="question">\r\n        ${currentQuestion.questionNum}) ${currentQuestion.question}\r\n        textu?\r\n      </div>\r\n      <div style="font-size: 0.45cm; margin-bottom: 3mm" id="subtitle">\r\n      ${currentQuestion.subtitle}\r\n      </div>\r\n      <div style="display: flex; margin-bottom: 3mm">\r\n        <span style="flex: 1">A)</span>\r\n        <span style="flex: 14">${currentQuestion.options[0].text}</span>\r\n      </div>\r\n      <div style="display: flex; margin-bottom: 3mm">\r\n        <span style="flex: 1">B)</span>\r\n        <span style="flex: 14"\r\n          >${currentQuestion.options[1].text}</span\r\n        >\r\n      </div>\r\n      <div style="display: flex; margin-bottom: 3mm">\r\n        <span style="flex: 1">C)</span>\r\n        <span style="flex: 14">${currentQuestion.options[2].text}</span>\r\n      </div>\r\n      <div style="display: flex; margin-bottom: 3mm">\r\n        <span style="flex: 1">D)</span>\r\n        <span style="flex: 14">${currentQuestion.options[3].text}</span>\r\n      </div>\r\n    </section>`;\r\n    */\r\n\r\n/*\r\n//ANO/NE\r\nconst numberOfSubquestions = currentQuestion.questions.length;\r\n// i = the index of the current subquestion\r\nconst i = 0;\r\n\r\nfunction generateSubQuestionsHTML(subQuestions) {\r\n  return subQuestions\r\n    .map(\r\n      (subQuestion, index) => `<div style="display: flex; margin-bottom: 3mm">\r\n          <span style="flex: 1">${currentQuestion.questionNum}.${\r\n        index + 1\r\n      }</span>\r\n          <span style="flex: 14"\r\n            >${subQuestion.text}</span\r\n          >\r\n          <span style="flex: 1; transform: scale(2); text-align: center"\r\n            >\u2610</span\r\n          >\r\n          <span style="flex: 1; transform: scale(2); text-align: center"\r\n            >\u2610</span\r\n          >\r\n        </div>`\r\n    )\r\n    .join("");\r\n}\r\n\r\n// Replace subQuestionsHTML with the generated HTML\r\nconst subQuestionsHTML = generateSubQuestionsHTML(currentQuestion.questions);\r\n\r\nconst subQuestionsHTMLJSON = currentQuestion.questions;\r\nconst totalPoints = subQuestionsHTMLJSON.reduce(\r\n  (sum, item) => sum + item.points,\r\n  0\r\n);\r\nconst ANONEquestionTemplate = `<section style="position: relative">\r\n      <div style="text-align: right; font-weight: bold; margin-top: 0.5cm">\r\n      ${totalPoints} ${getBodForm(totalPoints)}\r\n      </div>\r\n      <div style="font-weight: bold" id="question">\r\n        ${currentQuestion.questionNum}) ${currentQuestion.title}\r\n      </div>\r\n      <div style="font-size: 0.45cm; margin-bottom: 3mm" id="subtitle">\r\n        Tohle je podnadpis k ot\u00E1zce, tento podnadpis slou\u017E\u00ED pouze jako p\u0159\u00EDklad\r\n        toho jak podnadpis vypad\u00E1.\r\n      </div>\r\n      <div style="transform: translateY(-5mm)">\r\n        <div\r\n          style="\r\n            display: flex;\r\n            margin-bottom: 3mm;\r\n            font-weight: bold;\r\n            margin-top: 5mm;\r\n          "\r\n        >\r\n          <span style="flex: 15"></span>\r\n          <span style="flex: 1; text-align: center">A</span>\r\n          <span style="flex: 1; text-align: center">N</span>\r\n        </div>\r\n        ${subQuestionsHTML}\r\n      </div>\r\n      </section>`;\r\n\r\n*/\r\n\r\n/*\r\n// Prirazovani\r\nconst totalPoints = currentQuestion.questions.reduce(\r\n  (sum, item) => sum + item.points,\r\n  0\r\n);\r\nconst prirazovaniQuestionTemplate = `<section style="position: relative">\r\n      <!--P\u0159i\u0159azov\u00E1n\u00ED question-->\r\n      <div style="text-align: right; font-weight: bold; margin-top: 0.5cm">\r\n      ${totalPoints} ${getBodForm(totalPoints)}\r\n      </div>\r\n      <div style="font-weight: bold" id="question">\r\n        ${currentQuestion.questionNum}) ${currentQuestion.title}\r\n      </div>\r\n      <div style="font-size: 0.45cm" id="subtitle">\r\n      ${currentQuestion.subtitle}\r\n      </div>\r\n      <div style="margin-bottom: 1cm; margin-top: 3mm">\r\n        <div style="display: flex; margin-bottom: 3mm">\r\n          <span style="flex: 1"><section style="position: relative">\r\n     <section>\r\n        <div>\r\n          <div style="display: flex; margin-bottom: 3mm">\r\n            <span style="flex: 1">${currentQuestion.questionNum}.1</span>\r\n            <span style="flex: 14">${currentQuestion.questions[0].text}</span>\r\n            <span style="flex: 1; border-bottom: 0.3mm solid #000"></span>\r\n          </div>\r\n          <div style="display: flex; margin-bottom: 3mm">\r\n            <span style="flex: 1">${currentQuestion.questionNum}.2</span>\r\n            <span style="flex: 14">${currentQuestion.questions[1].text}</span>\r\n            <span style="flex: 1; border-bottom: 0.3mm solid #000"></span>\r\n          </div>\r\n          <div style="display: flex; margin-bottom: 3mm">\r\n            <span style="flex: 1">${currentQuestion.questionNum}.3</span>\r\n            <span style="flex: 14">${currentQuestion.questions[2].text}</span>\r\n            <span style="flex: 1; border-bottom: 0.3mm solid #000"></span>\r\n          </div>\r\n       </div>\r\n        <div style="margin-top: 1cm">\r\n          <div style="display: flex; margin-bottom: 3mm">\r\n            <span style="flex: 1">A)</span>\r\n            <span style="flex: 14">${currentQuestion.options[0].text}</span>\r\n          </div>\r\n          <div style="display: flex; margin-bottom: 3mm">\r\n            <span style="flex: 1">B)</span>\r\n            <span style="flex: 14">${currentQuestion.options[1].text}</span>\r\n          </div>\r\n          <div style="display: flex; margin-bottom: 3mm">\r\n            <span style="flex: 1">C)</span>\r\n            <span style="flex: 14">${currentQuestion.options[2].text}</span>\r\n          </div>\r\n          <div style="display: flex; margin-bottom: 3mm">\r\n            <span style="flex: 1">D)</span>\r\n            <span style="flex: 14">${currentQuestion.options[3].text}</span>\r\n          </div>\r\n          <div style="display: flex; margin-bottom: 3mm">\r\n            <span style="flex: 1">E)</span>\r\n            <span style="flex: 14">${currentQuestion.options[4].text}</span>\r\n          </div>\r\n    </section>`;\r\n*/\r\n\r\n/*\r\n// Otevrena uloha\r\nconst otevrenaUlohaQuestionTemplate = `<section style="position: relative">\r\n      <div style="text-align: right; font-weight: bold; margin-top: 0.5cm">\r\n      ${currentQuestion.points} ${getBodForm(currentQuestion.points)}\r\n      </div>\r\n      <div style="font-weight: bold; margin-bottom: 3mm" id="question">\r\n        ${currentQuestion.questionNum}) ${currentQuestion.title}\r\n      </div>\r\n      <div style="font-size: 0.45cm; margin-bottom: 3mm" id="subtitle">\r\n      ${currentQuestion.subtitle}\r\n      </div>\r\n    </section>`;\r\n*/\r\n\r\n/*\r\n// V\u00FDchoz\u00ED text\r\nconst otevrenaUlohaQuestionTemplate = `<section style="margin-top: 1cm">\r\n      <div\r\n        style="\r\n          font-weight: bold;\r\n          margin-bottom: 1.5mm;\r\n          text-transform: uppercase;\r\n        "\r\n      >\r\n        V\u00FDchoz\u00ED text\r\n      </div>\r\n      <div style="border: 0.4mm solid #000; padding: 3mm">\r\n        ${currentQuestion.content}\r\n        <div\r\n          style="\r\n            text-align: right;\r\n            margin-top: 5mm;\r\n            font-style: italic;\r\n            font-size: 0.4cm;\r\n          "\r\n        >\r\n        ${currentQuestion.source}\r\n        </div>\r\n      </div>\r\n    </section>`;\r\n  */\r\n\r\nfunction generateTestHTML() {\r\n  let skipNext = false; // Flag to skip the next question if already included\r\n  return (\r\n    questions\r\n      .map((question, index) => {\r\n        if (skipNext) {\r\n          skipNext = false; // Reset the flag and skip this iteration\r\n          return "";\r\n        }\r\n\r\n        let html = "";\r\n        if (\r\n          question.type === "DEFAULT_TEXT" ||\r\n          question.type === "IMAGE_UPLOAD"\r\n        ) {\r\n          const nextQuestion = questions[index + 1];\r\n          html += `<div>`;\r\n          html += generateQuestionHTML(question);\r\n          if (nextQuestion) {\r\n            html += generateQuestionHTML(nextQuestion);\r\n            skipNext = true; // Mark the next question to be skipped\r\n          }\r\n          html += `</div>`;\r\n          return html;\r\n        }\r\n        return generateQuestionHTML(question);\r\n      })\r\n      .join("") +\r\n    `<section\r\n      style="\r\n        border-block: 0.3mm solid black;\r\n        margin-top: 1cm;\r\n        text-align: center;\r\n        font-weight: bold;\r\n        padding-block: 1mm;\r\n      "\r\n    >\r\n      ZKONTROLUJTE, ZDA JSTE DO Z\u00C1ZNAMOV\u00C9HO ARCHU UVEDL/A V\u0160ECHNY ODPOV\u011ADI.\r\n    </section>`\r\n  );\r\n}\r\n\r\nfunction generateQuestionHTML(question) {\r\n  switch (question.type) {\r\n    case "ABCD":\r\n      return `<section style="position: relative">\r\n            <div style="text-align: right; font-weight: bold; margin-top: 0.5cm">\r\n              ${question.points} ${getBodForm(question.points)}\r\n            </div>\r\n            <div style="font-weight: bold" id="question">\r\n              ${question.questionNum}) ${question.question}\r\n            </div>\r\n            <div style="font-size: 0.45cm; margin-bottom: 3mm" id="subtitle">\r\n              ${question.subtitle}\r\n            </div>\r\n            ${question.options\r\n              .map(\r\n                (\r\n                  option,\r\n                  index\r\n                ) => `<div style="display: flex; margin-bottom: 3mm">\r\n                  <span style="flex: 1">${String.fromCharCode(\r\n                    65 + index\r\n                  )})</span>\r\n                  <span style="flex: 14">${option.text}</span>\r\n                </div>`\r\n              )\r\n              .join("")}\r\n          </section>`;\r\n    case "ANO-NE":\r\n      const subQuestionsHTML = question.questions\r\n        .map(\r\n          (\r\n            subQuestion,\r\n            index\r\n          ) => `<div style="display: flex; margin-bottom: 3mm">\r\n                <span style="flex: 1">${question.questionNum}.${\r\n            index + 1\r\n          }</span>\r\n                <span style="flex: 14">${subQuestion.text}</span>\r\n                <span style="flex: 1; transform: scale(2); text-align: center">\u2610</span>\r\n                <span style="flex: 1; transform: scale(2); text-align: center">\u2610</span>\r\n              </div>`\r\n        )\r\n        .join("");\r\n      const totalPoints = question.questions.reduce(\r\n        (sum, item) => sum + item.points,\r\n        0\r\n      );\r\n      return `<section style="position: relative">\r\n            <div style="text-align: right; font-weight: bold; margin-top: 0.5cm">\r\n              ${totalPoints} ${getBodForm(totalPoints)}\r\n            </div>\r\n            <div style="font-weight: bold" id="question">\r\n              ${question.questionNum}) ${question.title}\r\n            </div>\r\n            <div style="font-size: 0.45cm; margin-bottom: 3mm" id="subtitle">\r\n              ${question.subtitle}\r\n            </div>\r\n            <div style="transform: translateY(-5mm)">\r\n              <div style="display: flex; margin-bottom: 3mm; font-weight: bold; margin-top: 5mm;">\r\n                <span style="flex: 15"></span>\r\n                <span style="flex: 1; text-align: center">A</span>\r\n                <span style="flex: 1; text-align: center">N</span>\r\n              </div>\r\n              ${subQuestionsHTML}\r\n            </div>\r\n          </section>`;\r\n    case "PRIRAZOVANI":\r\n      const prirazovaniHTML = question.questions\r\n        .map(\r\n          (\r\n            subQuestion,\r\n            index\r\n          ) => `<div style="display: flex; margin-bottom: 3mm">\r\n                <span style="flex: 1">${question.questionNum}.${\r\n            index + 1\r\n          }</span>\r\n                <span style="flex: 14">${subQuestion.text}</span>\r\n                <span style="flex: 1; border-bottom: 0.3mm solid #000"></span>\r\n              </div>`\r\n        )\r\n        .join("");\r\n      const optionsHTML = question.options\r\n        .map(\r\n          (option, index) => `<div style="display: flex; margin-bottom: 3mm">\r\n                <span style="flex: 1">${String.fromCharCode(65 + index)})</span>\r\n                <span style="flex: 14">${option.text}</span>\r\n              </div>`\r\n        )\r\n        .join("");\r\n      return `<section style="position: relative">\r\n            <div style="text-align: right; font-weight: bold; margin-top: 0.5cm">\r\n              ${question.totalPoints} ${getBodForm(question.totalPoints)}\r\n            </div>\r\n            <div style="font-weight: bold" id="question">\r\n              ${question.questionNum}) ${question.title}\r\n            </div>\r\n            <div style="font-size: 0.45cm" id="subtitle">\r\n              ${question.subtitle}\r\n            </div>\r\n            <div style="margin-bottom: 1cm; margin-top: 3mm">\r\n              ${prirazovaniHTML}\r\n              <div style="margin-top: 1cm">\r\n                ${optionsHTML}\r\n              </div>\r\n            </div>\r\n          </section>`;\r\n    case "OPEN":\r\n      return `<section style="position: relative">\r\n            <div style="text-align: right; font-weight: bold; margin-top: 0.5cm">\r\n              ${question.points} ${getBodForm(question.points)}\r\n            </div>\r\n            <div style="font-weight: bold; margin-bottom: 3mm" id="question">\r\n              ${question.questionNum}) ${question.title}\r\n            </div>\r\n            <div style="font-size: 0.45cm; margin-bottom: 3mm" id="subtitle">\r\n              ${question.subtitle}\r\n            </div>\r\n          </section>`;\r\n    case "DEFAULT_TEXT":\r\n      return `<section style="margin-top: 1cm">\r\n        <div style="font-weight: bold; margin-bottom: 1.5mm; text-transform: uppercase;">\r\n          V\u00FDchoz\u00ED text\r\n        </div>\r\n        <div style="border: 0.4mm solid #000; padding: 3mm">\r\n          ${question.content}\r\n          <div style="text-align: right; margin-top: 5mm; font-style: italic; font-size: 0.4cm;">\r\n            ${question.source}\r\n          </div>\r\n        </div>\r\n      </section>`;\r\n    case "IMAGE_UPLOAD":\r\n      return `<section style="margin-top: 1cm">\r\n        <div style="font-weight: bold; margin-bottom: 1.5mm; text-transform: uppercase;">\r\n          Obr\u00E1zek\r\n        </div>\r\n        <div style="border: 0.4mm solid #000; padding: 3mm; text-align: center;">\r\n          <img src="${\r\n            question.imageBase64\r\n          }" alt="Uploaded Image" style="max-width: 100%; max-height: 10cm; height: auto;" />\r\n          ${\r\n            question.source\r\n              ? `<div style="text-align: right; margin-top: 5mm; font-style: italic; font-size: 0.4cm;">\r\n                  ${question.source}\r\n                </div>`\r\n              : ""\r\n          }\r\n        </div>\r\n      </section>`;\r\n    default:\r\n      console.warn(`Unknown question type: ${question.type}`);\r\n      return "";\r\n  }\r\n}\r\n\r\n// Example usage:\r\n// const testHTML = generateTestHTML();\r\n// console.log(testHTML);\r\n\r\nasync function createMergedPDF() {\r\n  const html1 = `\r\n      <style>\r\n      @font-face {\r\n        font-family: "MyriadPro";\r\n        font-weight: normal;\r\n        src: url("./src/fonts/MyriadPro-Regular.ttf") format("truetype");\r\n      }\r\n      @font-face {\r\n        font-family: "MyriadPro";\r\n        font-weight: bold;\r\n        src: url("./src/fonts/MyriadPro-Bold.ttf") format("truetype");\r\n      }\r\n\r\n      body {\r\n        all: unset;\r\n        background-color: #fff;\r\n        font-family: MyriadPro, sans-serif;\r\n        display: block;\r\n        width: 21cm;\r\n        height: fit-content;\r\n        padding: 2.4cm 2.6cm 0.5cm 2.6cm;\r\n        font-size: 0.5cm;\r\n      }\r\n    </style>\r\n  <section style="max-height: 266mm; overflow: hidden;">\r\n      <!--First page-->\r\n      <h1 style="font-size: 0.75cm; margin: 0; text-transform: uppercase">\r\n        ${nazevTestu}\r\n      </h1>\r\n      <hr style="margin-bottom: 0.4cm; border-top: 1px solid #000" />\r\n      <div style="display: flex">\r\n        <span style="width: 50%; padding-right: 3mm">\r\n          <div\r\n            style="\r\n              font-size: 0.5cm;\r\n              font-weight: bold;\r\n              margin-bottom: 0.7cm;\r\n              text-transform: uppercase;\r\n            "\r\n          >\r\n            TEST\r\n          </div>\r\n          <b style="display: block; font-size: 0.415cm">Po\u010Det \u00FAloh: ${pocetUloh}</b>\r\n          <b style="display: block; font-size: 0.415cm"\r\n            >Maxim\u00E1ln\u00ED bodov\u00E9 hodnocen\u00ED: ${maxBodu} bod\u016F</b\r\n          >\r\n          <b style="display: block; font-size: 0.415cm">Povolen\u00E9 pom\u016Fcky: ${povolenePomucky}</b>\r\n        </span>\r\n        <span style="width: 50%">\r\n          <div>Jm\u00E9no a p\u0159\u00EDjmen\u00ED</div>\r\n          <div\r\n            style="border: 0.3mm solid #000000; height: 1.1cm; margin-top: 1mm"\r\n          ></div>\r\n        </span>\r\n      </div>\r\n      <hr style="margin-bottom: 0.4cm; border-top: 1px solid #000" />\r\n      <style>\r\n        .number {\r\n          border: 0.3mm solid #000000;\r\n          position: absolute;\r\n          font-weight: bold;\r\n          padding: 0.5mm;\r\n        }\r\n        .point {\r\n          position: absolute;\r\n          padding: 0.5mm;\r\n          transform: translateY(-0.1cm);\r\n        }\r\n        .moved {\r\n          transform: translateX(0.6cm);\r\n          width: calc(100% - 1.2cm - 0.3cm);\r\n          display: block;\r\n          margin-bottom: 1mm;\r\n        }\r\n      </style>\r\n      <div style="display: flex; font-size: 0.415cm">\r\n        <span style="width: 50%">\r\n          <span class="number" style="transform: translateY(-0.1cm)">1</span>\r\n          <span\r\n            class="moved"\r\n            style="\r\n              text-decoration: underline;\r\n              font-weight: bold;\r\n              margin-bottom: 3mm;\r\n            "\r\n          >\r\n            Z\u00E1kladn\u00ED informace k zad\u00E1n\u00ED zkou\u0161ky\r\n          </span>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            <b>\u010Casov\u00FD limit</b> pro \u0159e\u0161en\u00ED testu\r\n            <b>je uveden na z\u00E1znamov\u00E9m archu</b>.\r\n          </div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">U ka\u017Ed\u00E9 \u00FAlohy je uveden maxim\u00E1ln\u00ED po\u010Det bod\u016F.</div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Za neuveden\u00E9 \u0159e\u0161en\u00ED \u00FAlohy \u010Di za nespr\u00E1vn\u00E9 \u0159e\u0161en\u00ED \u00FAlohy jako celku\r\n            <b>se neud\u011Bluj\u00ED z\u00E1porn\u00E9 body</b>.\r\n          </div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved"><b>Odpov\u011Bdi pi\u0161te do z\u00E1znamov\u00E9ho archu.</b></div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Pozn\u00E1mky si m\u016F\u017Eete d\u011Blat do testov\u00E9ho se\u0161itu, nebudou v\u0161ak p\u0159edm\u011Btem\r\n            hodnocen\u00ED.\r\n          </div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            <b\r\n              >Nejednozna\u010Dn\u00FD nebo ne\u010Diteln\u00FD z\u00E1pis odpov\u011Bdi bude pova\u017Eov\u00E1n za\r\n              chybn\u00E9 \u0159e\u0161en\u00ED.</b\r\n            >\r\n          </div>\r\n          <span class="number" style="transform: translateY(0.3cm)">2</span>\r\n          <span\r\n            class="moved"\r\n            style="\r\n              text-decoration: underline;\r\n              font-weight: bold;\r\n              margin-top: 0.5cm;\r\n              margin-bottom: 3mm;\r\n            "\r\n          >\r\n            Pravidla spr\u00E1vn\u00E9ho z\u00E1pisu odpov\u011Bd\u00ED\r\n          </span>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Odpov\u011Bdi zaznamen\u00E1vejte <b>mod\u0159e nebo \u010Dern\u011B</b> p\u00ED\u0161\u00EDc\u00ED propisovac\u00ED\r\n            tu\u017Ekou, kter\u00E1 pi\u0161e <b>dostate\u010Dn\u011B siln\u00E9 a nep\u0159eru\u0161ovan\u011B</b>.\r\n          </div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            <b>Hodnoceny budou pouze odpov\u011Bdi uveden\u00E9 v z\u00E1znamov\u00E9m archu.</b>\r\n          </div>\r\n          <span class="number" style="transform: translateY(0.3cm)">2.1</span>\r\n          <span\r\n            class="moved"\r\n            style="\r\n              text-decoration: underline;\r\n              font-weight: bold;\r\n              margin-top: 0.5cm;\r\n              margin-bottom: 3mm;\r\n              transform: translateX(1cm);\r\n            "\r\n          >\r\n            Pokyny k uzav\u0159en\u00FDm \u00FAloh\u00E1m\r\n          </span>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            U v\u0161ech \u00FAloh/pod\u00FAloh <b>je pr\u00E1v\u011B jedna odpov\u011B\u010F spr\u00E1vn\u00E1</b>.\r\n          </div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Odpov\u011B\u010F na \u00FAlohu/pod\u00FAlohu z\u0159eteln\u011B zak\u0159\u00ED\u017Ekujte v p\u0159\u00EDslu\u0161n\u00E9m b\u00EDl\u00E9m\r\n            poli z\u00E1znamov\u00E9ho archu, a to p\u0159esn\u011B z rohu do rohu dle obr\u00E1zku.\r\n          </div><img class="moved" style="width: 3.6cm;" src="data:image/png;base64," alt="" />\r\n        </span>\r\n        <span\r\n          style="width: 50%; border-left: 0.3mm solid #000; padding-left: 1cm"\r\n        >\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Pokud budete cht\u00EDt n\u00E1sledn\u011B zvolit jinou odpov\u011B\u010F, pe\u010Dliv\u011B zabarv\u011Bte\r\n            p\u016Fvodn\u00E9 zak\u0159\u00ED\u017Ekovan\u00E9 pole a zvolenou odpov\u011Bd vyzna\u010Dte k\u0159\u00ED\u017Ekem do\r\n            nov\u00E9ho pole.\r\n          </div>\r\n          <img class="moved" style="width: 3.6cm;" src="data:image/png;base64," alt="" />\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Jak\u00FDkoli jin\u00FD zp\u016Fsob z\u00E1znamu odpov\u011Bd\u00ED a jejich oprav bude pova\u017Eov\u00E1n\r\n            za nespr\u00E1vnou odpov\u011B\u010F.\r\n          </div>\r\n\r\n          <span class="number" style="transform: translateY(0.3cm)">2.2</span>\r\n          <span\r\n            class="moved"\r\n            style="\r\n              text-decoration: underline;\r\n              font-weight: bold;\r\n              margin-top: 0.5cm;\r\n              margin-bottom: 3mm;\r\n              transform: translateX(1cm);\r\n            "\r\n          >\r\n            Pokyny k otev\u0159en\u00FDm \u00FAloh\u00E1m\r\n          </span>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Odpov\u011Bdi <b>pi\u0161te \u010Diteln\u011B</b> do vyzna\u010Den\u00FDch b\u00EDl\u00FDch pol\u00ED.\r\n          </div>\r\n          <img\r\n          class="moved" \r\n            style="width: calc(100% - 1.2cm - 0.3cm); margin-bottom: 2mm"\r\n          src="data:image/png;base64,"\r\n          />\r\n          \r\n          <div class="point">\u2981</div>\r\n          <div class="moved">Povoleno je psac\u00ED i tiskac\u00ED p\u00EDsmo a \u010D\u00EDslice.</div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            P\u0159i psan\u00ED odpov\u011Bd\u00ED rozli\u0161ujte <b>velk\u00E1 a mal\u00E1 p\u00EDsmena</b>.\r\n          </div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Pokud budete cht\u00EDt n\u00E1sledn\u011B zvolit jinou odpov\u011B\u010F, p\u016Fvodn\u00ED odpov\u011B\u010F\r\n            p\u0159e\u0161krtn\u011Bte a novou odpov\u011B\u010F zapi\u0161te do stejn\u00E9ho pole. Va\u0161e odpov\u011B\u010F\r\n            nesm\u00ED p\u0159es\u00E1hnout hranice vyzna\u010Den\u00E9ho pole.\r\n          </div>\r\n          <div class="point">\u2981</div>\r\n          <div class="moved">\r\n            Za chybu se pova\u017Euje jak jak\u00E1koli nespr\u00E1vn\u00E1, tak chyb\u011Bj\u00EDc\u00ED spr\u00E1vn\u00E1\r\n            d\u00EDl\u010D\u00ED odpov\u011B\u010F. Maxim\u00E1ln\u00ED dosa\u017Eiteln\u00E9 bodov\u00E9 hodnocen\u00ED za \u00FAlohu se\r\n            sn\u00ED\u017E\u00ED o zapo\u010D\u00EDtan\u00E9 chyby.\r\n          </div>\r\n        </span>\r\n      </div>\r\n      <hr style="margin-bottom: 0.2cm; border-top: 1px solid #000" />\r\n      <div\r\n        style="\r\n          text-transform: uppercase;\r\n          font-weight: bold;\r\n          text-align: center;\r\n          font-size: 0.55cm;\r\n        "\r\n      >\r\n        Testov\u00FD se\u0161it neotv\u00EDrejte, po\u010Dkejte na pokyn!\r\n      </div>\r\n      <hr style="margin-top: 0.2cm; border-top: 1px solid #000" />\r\n\r\n    </section>`;\r\n  const html2 = generateTestHTML();\r\n\r\n  // Define your options\r\n  const options = {\r\n    pagebreak: { mode: ["avoid-all", "css"] },\r\n    margin: [15, 15, 15, 15],\r\n    filename: `${nazevTestu}.pdf`,\r\n    image: { type: "png", quality: 1 },\r\n    html2canvas: { scale: 2.5 },\r\n    jsPDF: { unit: "mm", format: "a4", orientation: "portrait" },\r\n  };\r\n\r\n  // Create jsPDF instance\r\n  const pdf = new window.jspdf.jsPDF(options.jsPDF);\r\n\r\n  // First conversion\r\n  await html2pdf()\r\n    .set({ ...options, pdf })\r\n    .from(html1)\r\n    .toPdf()\r\n    .get("pdf")\r\n    .then(() => pdf.addPage());\r\n\r\n  // Second conversion\r\n  await html2pdf()\r\n    .set({ ...options, pdf })\r\n    .from(html2)\r\n    .toPdf();\r\n\r\n  const totalPages = pdf.getNumberOfPages();\r\n  for (let i = 1; i <= totalPages; i++) {\r\n    pdf.setPage(i);\r\n    pdf.setFontSize(12.5);\r\n    pdf.setFont("Helvetica", "bold");\r\n    const pageWidth = pdf.internal.pageSize.getWidth();\r\n    const pageHeight = pdf.internal.pageSize.getHeight();\r\n    const text = `${i}`;\r\n    // Calculate text width for perfect centering\r\n    const textWidth = pdf.getTextWidth(text);\r\n    const x = (pageWidth - textWidth) / 2;\r\n    const y = pageHeight - 10; // 10 units from the bottom\r\n    pdf.text(text, x, y);\r\n  }\r\n\r\n  pdf.save(options.filename);\r\n  window.close(); // This closes the tab after 2 seconds\r\n}\r\n\r\ncreateMergedPDF();\r\n\r\n    </script>\r\n    </body>\r\n  </html>\r\n';
  const newTab = window.open("about:blank", "_blank");
  newTab.document.write(content);

  newTab.document.close(); // Finish writing to the document
}
